import { StyleSheet } from 'react-native';

export default style = StyleSheet.create(
{
    container: {
        flex: 1,
        alignItems: 'center',
        justifyContent: 'center',
    },
    texto: {
        fontSize: 30,
        color: 'red',
    },
    image: {
        width: 300,
        height: 210,
    }
})
